import React from 'react'
import SHOP_DATA from './shop.data';

class ShopList extends React.Component{
    constructor(){
        super();
        this.state={
            Shopdata:SHOP_DATA
        }
    }
        render()
        {
            return(
                <div>
                    <h1>Shop List</h1>
                    <h2>{this.state.Shopdata}</h2>
                </div>
            )
        }
    }


export default ShopList;
